        return(
            <div className='card-container' key={this.props.key}>
            <img
                alt={`robot ${this.props.name}`}
                src={`https://robohash.org/${id}?set=set1@size=180x180`}
            />
            <h2>{this.props.name}</h2>
            <p>{this.props.email}</p>
            </div>
        );
   }
}

export default CardContainer
